import React from 'react';
import { Inputs, Form, InlineForm, InputSeparator, Button, DefaultInput } from "../form/inputs";


const ContactUsForm = () => {
    return (
        <>
            <Form>
                <InlineForm>
                    <DefaultInput
                        placeholder="Full name..."
                        id="fullname"
                    />

                    <DefaultInput placeholder="Email address..." id="emailaddress" />

                </InlineForm>
                <DefaultInput
                    placeholder="Subject"
                    id="subject"
                />


                <Button>Request Now</Button>
            </Form>
        </>
    );
}

export default ContactUsForm;
